import Layout from '../components/MyLayout';

const Page = () => {
  return (
    <Layout>
      <h1>Joshua Worley</h1>
    <h2>Digital Producer. Leader. SEO Marker. Bilingual. Photographer. Videographer. UI/UX Designer and Frontend Engineer with a passion for experience creation.</h2>
    </Layout>
  );
}

export default Page;
